} fn main() { let t_list = List::new(); println!("{:?}", t_list); let mut new_list = t_list.insert_to_fth(3); println!("{:?}", new_list); for n in 1..10 { new_list = new_list.insert_to_fth(n); match &new_list { List::Cons(_, ref tail) => { println!("List : {:?} : len : {:?}", new_list, tail.len()); } List::Nil => todo!(), } } let print = new_list.stringify(); println!("{}", print);
}

